import logo from './logo.svg';
import './App.css';
import React, { Suspense, lazy } from 'react';
import { BrowserRouter as Switch, Router, Routes, Route , Link, BrowserRouter} from 'react-router-dom';
import Home from './pages/home/home.component';
import ShopPage from './pages/shop/shop.component';
import Contacts from './pages/contacts/contacts.component';
import Header from './components/header/header.component';

// const Home = lazy(() => import('./pages/home/home.component'));
// const ShopPage = lazy(() => import('./pages/shop/shop.component'));
// const Contacts = lazy(() => import('./pages/contacts/contacts.component'));
// const Header = lazy(() => import('./components/header/header.component'));
const Head=()=>(

  <Switch>
    <Route exact path="/" component={Home} />
      <Route path="/about" component={Head} />
      <Route path="/shop" component={ShopPage} />
      <Route path="/contacts" component={Contacts} />
  </Switch>

);
const Paths=()=>(


  <Router>

  <Suspense fallback={<div>Loading...</div>}>
    <Routes>
      <Route exact path="/" element={<Home />} />
      <Route path="/about" element={<Head />} />
      <Route path="/shop" element={<ShopPage />} />
      <Route path="/contacts" element={<Contacts />} />
    </Routes>
  </Suspense>
</Router>

);
function App() {

  return (
    <div>  
    <Header />
    <Head />

    </div>
  );
}

export default App;
